import React from "react";
import { useHistory } from "react-router-dom";



export default function StudentLayout({childre}) {
    let history = useHistory();
    return (

        <div className="s-page col-12">

            <header className="s-header col-12" style={{ backgroundColor: 'hotpink', height: '50px' }}>

            </header>

            <section className="mid row">
                <navbar className="s-nav col-2" style={{ backgroundColor: 'green' }}>
                    <button className="btn btn-block m-2" onClick={()=>history.push('/')}>DASHBOARD</button>
                    <button className="btn btn-block m-2">PROFILE</button>
                    <button className="btn btn-block m-2">ADD PROFILE</button>
                </navbar>

                <div className="s-content col-10" style={{ backgroundColor: 'yellow' }}>

                </div>

            </section>

            <footer className="s-footer col-12" style={{ backgroundColor: 'orange' }}>

            </footer>

        </div>

    );
}
